import React from "react";
import NotLoggedIn from "./NotLoggedIn";

export default class LoginForm extends React.Component {
  constructor() {
    super();
    this.state = {};
  }
  notLoggedIn = () => {
    if (true) {
      return <NotLoggedIn></NotLoggedIn>;
    }else{
        <div>
        <h1>Hello</h1>
      </div>
    }
  };

  render() {
    return this.notLoggedIn
  }
}
